import{_ as t}from"./chunks/log_download.DNJj99t9.js";import{_ as a,c as o,a8 as r,o as i}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"Політні звіти","description":"","frontmatter":{},"headers":[],"relativePath":"uk/getting_started/flight_reporting.md","filePath":"uk/getting_started/flight_reporting.md"}'),l={name:"uk/getting_started/flight_reporting.md"};function n(s,e,g,h,c,d){return i(),o("div",null,e[0]||(e[0]=[r('<h1 id="політні-звіти" tabindex="-1">Політні звіти <a class="header-anchor" href="#політні-звіти" aria-label="Permalink to &quot;Політні звіти&quot;">​</a></h1><p>PX4 реєструє детальний стан апарату і дані датчиків, які можна використовувати для аналізу проблем з продуктивністю. У цій темі пояснюється, як ви можете завантажувати та аналізувати бортові журнали, а також ділитися ними з командою розробників.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Keeping flight logs is a legal requirement in some jurisdictions.</p></div><h2 id="завантаження-журналів-з-політного-контролера" tabindex="-1">Завантаження журналів з політного контролера <a class="header-anchor" href="#завантаження-журналів-з-політного-контролера" aria-label="Permalink to &quot;Завантаження журналів з політного контролера&quot;">​</a></h2><p>Logs can be downloaded using <a href="http://qgroundcontrol.com/" target="_blank" rel="noreferrer">QGroundControl</a>: <strong><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/analyze_view/log_download.html" target="_blank" rel="noreferrer">Analyze View &gt; Log Download</a></strong>.</p><p><img src="'+t+'" alt="Flight Log Download"></p><h2 id="аналіз-журналів" tabindex="-1">Аналіз журналів <a class="header-anchor" href="#аналіз-журналів" aria-label="Permalink to &quot;Аналіз журналів&quot;">​</a></h2><p>Upload the log file to the online <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> tool. Після завантаження вам буде надіслано посилання на сторінку аналізу журналу.</p><p><a href="./../log/flight_review.html">Log Analysis using Flight Review</a> explains how to interpret the plots, and can help you to verify/reject the causes of common problems: excessive vibration, poor PID tuning, saturated controllers, imbalanced vehicles, GPS noise, etc.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>There are many other great tools for visualising and analysing PX4 Logs. For more information see: <a href="./../dev_log/flight_log_analysis.html">Flight Analysis</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If you have a constant high-rate MAVLink connection to the vehicle (not just a telemetry link) then you can use <em>QGroundControl</em> to automatically upload logs directly to <em>Flight Review</em>. For more information see <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/settings_view/mavlink.html#logging" target="_blank" rel="noreferrer">Settings &gt; MAVLink Settings &gt; MAVLink 2 Logging (PX4 only)</a>.</p></div><h2 id="надання-доступу-до-фаилів-журналів-розробникам-px4" tabindex="-1">Надання доступу до файлів журналів розробникам PX4 <a class="header-anchor" href="#надання-доступу-до-фаилів-журналів-розробникам-px4" aria-label="Permalink to &quot;Надання доступу до файлів журналів розробникам PX4&quot;">​</a></h2><p>The <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> log file link can be shared for discussion in the <a href="./../contribute/support.html#forums-and-chat">support forums</a> or a <a href="./../#reporting-bugs-issues">Github issue</a>.</p><h2 id="конфігурація-журналу" tabindex="-1">Конфігурація журналу <a class="header-anchor" href="#конфігурація-журналу" aria-label="Permalink to &quot;Конфігурація журналу&quot;">​</a></h2><p>The logging system is configured by default to collect sensible logs for use with <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a>.</p><p>Logging may further be configured using the <a href="./../advanced_config/parameter_reference.html#sd-logging">SD Logging</a> parameters or with a file on the SD card. Details on configuration can be found in the <a href="./../dev_log/logging.html#configuration">logging configuration documentation</a>.</p><h2 id="ключові-посилання" tabindex="-1">Ключові посилання <a class="header-anchor" href="#ключові-посилання" aria-label="Permalink to &quot;Ключові посилання&quot;">​</a></h2><ul><li><a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a></li><li><a href="./../log/flight_review.html">Log Analysis using Flight Review</a></li><li><a href="./../dev_log/flight_log_analysis.html">Flight Log Analysis</a></li></ul>',18)]))}const m=a(l,[["render",n]]);export{f as __pageData,m as default};
